const FlagBj = props => (
  <svg viewBox="0 0 15 10" {...props}>
    <path fill="#E8112D" d="M0 0h15v10H0z" />
    <path fill="#FCD116" d="M0 0h15v5H0z" />
    <path fill="#008751" d="M0 0h6v10H0z" />
  </svg>
);

export default FlagBj;
